import {React, useEffect } from 'react';

let text;
  function Hello() {

    useEffect( () => {

        async function fetchApi(){

          const data = await fetch('/api/user');
          text = await data.text();

        }

        fetchApi()
      } 
      )


      return (
          <div>
              {text}
          </div>
      )
  }

  export default Hello
